import styles from './animation.module.css';
import SpriteAnimator from "react-sequence-animator";

export default function MotionAnimation({ children, home }) {
    return (<div>
        <SequenceAnimator>
            <img src='/animations/Motion_secuence_v1/motion_00000.png' alt='Frame 0'></img>
            <img src='/animations/Motion_secuence_v1/motion_00001.png' alt='Frame 1'></img>
            <img src='/animations/Motion_secuence_v1/motion_00002.png' alt='Frame 2'></img>
        </SequenceAnimator>
      </div>)
  }
